      "path": "src/cli.ts",
      "content": "declare const require: any;
declare const process: any;

const fs = require("node:fs");
const path = require("node:path");

import { TaskStore } from "./store";

interface CliCommand {
  command: string;
  handler: (args: string[]) => void;
}

const commands: CliCommand[] = [
  {
    command: 'list',
    handler: args => {
      const dataPathArg = args.find(arg => arg.startsWith('--data='));
      if (!dataPathArg) return console.error('Missing --data argument');
      const dataPath = dataPathArg.slice(7);
      const store = new TaskStore(dataPath);
      console.log(JSON.stringify({ ok: true, tasks: store.list() }));
    }
  },
  {
    command: 'add',
    handler: args => {
      const titleIndex = args.indexOf('add') + 1;
      const dataPathArg = args.find(arg => arg.startsWith('--data='));
      if (!dataPathArg || titleIndex >= args.length) return console.error('Missing --data or title argument');
      const title = args[titleIndex];
      const dataPath = dataPathArg.slice(7);
      const store = new TaskStore(dataPath);
      console.log(JSON.stringify({ ok: true, task: store.add(title) }));
    }
  },
  {
    command: 'done',
    handler: args => {
      const idIndex = args.indexOf('done') + 1;
      const dataPathArg = args.find(arg => arg.startsWith('--data='));
      if (!dataPathArg || idIndex >= args.length) return console.error('Missing --data or id argument');
      const id = args[idIndex];
      const dataPath = dataPathArg.slice(7);
      const store = new TaskStore(dataPath);
      console.log(JSON.stringify({ ok: true, task: store.done(id) }));
    }
  },
  {
    command: 'remove',
    handler: args => {
      const idIndex = args.indexOf('remove') + 1;
      const dataPathArg = args.find(arg => arg.startsWith('--data='));
      if (!dataPathArg || idIndex >= args.length) return console.error('Missing --data or id argument');
      const id = args[idIndex];
      const dataPath = dataPathArg.slice(7);
      const store = new TaskStore(dataPath);
      console.log(JSON.stringify({ ok: true, task: store.remove(id) }));
    }
  }
];

const helpMessage = `
Usage:
  cli list --data <path>
  cli add <title> --data <path>
  cli done <id> --data <path>
  cli remove <id> --data <path>
`;

function main(): void {
  const args = process.argv.slice(2);
  if (args.includes('--help')) {
    console.log(helpMessage);
    process.exit(0);
  }

  const command = commands.find(cmd => args.includes(cmd.command));
  if (command) {
    try {
      command.handler(args);
    } catch (error: any) {
      console.error(`Error: ${error.message}`);
      process.exit(1);
    }
  } else {
    console.error('Unknown command. Use --help for more information.');
    process.exit(1);
  }
}

main();"
    }
